SELECT "INITIALDATE	transaction date before account initial date", __LEFT_TABLE.ACCOUNTID, __LEFT_TABLE.TRANSID, __LEFT_TABLE.TRANSDATE, __RIGHT_TABLE.INITIALDATE, __RIGHT_TABLE.ACCOUNTID FROM CHECKINGACCOUNT_V1 AS __LEFT_TABLE LEFT JOIN ACCOUNTLIST_V1 AS __RIGHT_TABLE ON __LEFT_TABLE.ACCOUNTID = __RIGHT_TABLE.ACCOUNTID WHERE __LEFT_TABLE.TRANSDATE < __RIGHT_TABLE.INITIALDATE AND (( DELETEDTIME is null OR DELETEDTIME = '' ))
